B.yr=new A.aS("Single Board stack","Hardware and setup improvements","### Tesla Android does not need the hardware HDMI capture interface anymore. Updated video layer also uses less resources.")
B.yF=new A.aS("Single system image","Setup improvements","### Starting with version 2022.44.1 there is a new way to install Tesla Android.\n### New single image setup process that does not need adb or fastboot. This change requires a 64GB(or larger) SD card.")
B.yv=new A.aS("LTE","Fixes for Huawei E3372","### Previous release broke support for Huawei E3372. This issue is now resolved.")
B.yM=new A.aS("Android platform","Boot time improvements","### Version 2022.44.1 includes multiple internal optimisations that allow for your Tesla Android to boot up faster after the car wakes from sleep.")
B.yJ=new A.aS("Virtual display","Performance and quality improvements","### Virtual display resolution has been increased to enable high fidelity Android experience in your Tesla.\n### The responsiveness is also improved thanks to internal changes in the video layer.")
B.y6=new A.aS("CarPlay","Performance improvements","### Improvements in the video layer leave more performance for other components.\n### Decoding video stream from CarPlay is faster in version 2022.44.1.")
B.yH=new A.aS("Flutter Frontend","Stability improvements","### Flutter frameworks has been updated in order to improve user experience.")
